import React, { useEffect } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getData } from '../actions/data';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const DataView = ({ data, getData, props }) => {
	useEffect(() => {
		getData();
	}, [getData]);

	const results = data.data;

	// console.log(results);
	// console.log(results[0].data);

	results.map(items => items.data.results.map(item => console.log(item)));

	return <h1 onClick={getData}>Reader</h1>;
};

DataView.propTypes = {
	DataView: PropTypes.func.isRequired
};

const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps, { getData })(DataView);
